import { AfterViewInit, Component } from '@angular/core';
import { DataFetchService } from '../../services/data-fetch.service';
import * as cornerstone from 'cornerstone-core';
import * as cornerstoneTools from 'cornerstone-tools';
import * as cornerstoneMath from 'cornerstone-math';
import Hammer from 'hammerjs';

const STORAGE_BASE_NAME = 'storageBase64';
const DEMO_STR =
  '';
// const DEMO_PATH = 'https://srv.carbonads.net/static/30242/15f7619952d3cdf0e1f51f9262d4afe75069da8a';
// const DEMO_PATH = 'http://devfront.top/public/images/2938.jpg';

// mask
// tslint:disable-next-line:max-line-length
const DEMO_PATH = 'http://192.168.6.35/predicts/1.2.156.600734.762202257.139620.1730459902.8499.5400253/biomind/98117e9d-a22b-11ef-a3bc-1b7ba874f173/mask/404754_20.png';

// bm
// tslint:disable-next-line:max-line-length
// const DEMO_PATH = 'http://192.168.6.35/bm/aacc748f-07a65df0-83053431-72c4d111-21f4cf0a/010bf150-f4eab77a-6a9f7301-33739b7e-82030c25/4bf4f05b-cb836d89-d127a2af-031c6553-a8963418_0';
const DEMO_STR1 =
  '';

@Component({
  selector: 'app-base-to-png',
  templateUrl: './base-to-png.component.html',
  styleUrls: ['./base-to-png.component.scss'],
})
export class BaseToPngComponent implements AfterViewInit {
  urlPath: any = '';
  loading = false;
  isDicom = false;

  dicomSize = {
    width: 369,
    height: 494,
  };

  pngConfig = {
    baseString: '',
    imgType: '', // 图像类型
    backgrounds: [
      { color: '#000', label: '黑' },
      { color: '#fff', label: '白' },
      { color: '#f00', label: '红' },
    ],
    background: '',
  };
  imgTypes = [
    { type: 'string', name: '字符串' },
    { type: 'url', name: 'url' },
  ];

  baseString: string;
  binaryString = '';
  // 是否显示所有的二进制字符串
  showAllBinaryString = false;

  list: any[];

  constructor(private fetchService: DataFetchService) {
    this.pngConfig.imgType = this.imgTypes[0].type;
    this.pngConfig.background = this.pngConfig.backgrounds[0].color;

    this.list = this.getBase64List();
  }

  ngAfterViewInit(): void {
    setTimeout(() => {
      this.setSelectionRange();
    }, 0);
    cornerstoneTools.external.cornerstone = cornerstone;
    cornerstoneTools.external.cornerstoneMath = cornerstoneMath;
    cornerstoneTools.external.Hammer = Hammer;
    cornerstoneTools.init({
      showSVGCursors: true,
    });
  }

  loadData(): void {
    this.getHttpData(this.urlPath);
    // this.fetchService.getFetchData(DEMO_PATH);
  }

  getHttpData(url = '', token = ''): void {
    this.fetchService.getFetchData(url, token).subscribe(async (res: any) => {
      const uint8Array = new Uint8Array(res);

      this.renderImg(uint8Array).then();
    });
  }
  async renderImg(uint8Array: Uint8Array, isBase64 = false): Promise<void> {
    this.loading = false;
    const { type, isImg } = this.fetchService.getFileType(uint8Array.slice(0, 35));
    // console.log('type:', type, isImg);
    this.isDicom = false;
    if (!isImg && type === 'unknown') {
      // use 3d 裸数据
      this.isDicom = true;
    }
    if (isImg || this.isDicom) {
      let image: any;
      if (isImg) {
        image = await this.fetchService.decodeImage(uint8Array, type, this.baseString);
      } else {
        image = this.fetchService.decode3dData(uint8Array, this.dicomSize);
      }
      if (image) {
        const element = document.getElementById('dicomImage');
        try {
          cornerstone.getEnabledElement(element);
          cornerstoneTools.clearToolState(element, 'stack');
        } catch (e) {
          cornerstone.enable(element);
          element.oncontextmenu = (e: any) => e.preventDefault();
          if (!cornerstoneTools.getToolForElement(element, 'Wwwc')) {
            cornerstoneTools.addTool(cornerstoneTools.WwwcTool);
            cornerstoneTools.setToolActive('Wwwc', { mouseButtonMask: 1 });

            cornerstoneTools.addTool(cornerstoneTools.ZoomTool);
            cornerstoneTools.setToolActive('Zoom', { mouseButtonMask: 2 });
          }
        }
        cornerstone.displayImage(element, image);
      }
    } else {
      console.log(`from base64: ${isBase64} ,type:【${type}】 not support!\n`, uint8Array);
    }
  }

  pngVal(): void {
    // console.log("origin: ",this.pngConfig.baseString);
    let str = this.pngConfig.baseString;
    if (!str) {
      this.binaryString = '';
      this.baseString = null;
      return;
    }
    // str 删除前后空格，删除前后引号 前后换行符
    str = str.trim().replace(/^["'\n]+|["'\n]+$/g, '');
    this.baseString = str;
    this.decode();
  }

  decode(): void {
    // 1. base64 转 uint8Array
    // console.log('baseString:》》》》》》 length', this.baseString.length);
    const { uint8Array, binaryString } = this.fetchService.base64ToArrayBuffer(this.baseString);
    this.binaryString = binaryString;
    if (uint8Array) {
      this.renderImg(uint8Array, true).then();
    }
  }

  setSelectionRange(): void {
    const input = document.querySelector('textarea');
    input?.select();
    if (document.execCommand) {
      document.execCommand('paste');
    }

    setTimeout(() => {
      this.pngVal();
    }, 10);
  }

  getBase64List(): Array<any> {
    return JSON.parse(localStorage.getItem(STORAGE_BASE_NAME) || '[]');
  }

  setBase64List(base64: string): void {
    const list = this.getBase64List();
    if (list.find((item) => item.base64 === base64)) {
      return;
    }
    list.unshift({ base64, date: new Date() });
    if (list.length > 5) {
      list.length = 5;
    }
    localStorage.setItem(STORAGE_BASE_NAME, JSON.stringify(list));
  }

  handleSample(): void {
    if (this.pngConfig.imgType === 'string') {
      this.pngConfig.baseString = DEMO_STR1;
      this.baseString = DEMO_STR1;
      this.dicomSize.width = 45;
      this.decode();
    } else {
      this.urlPath = DEMO_PATH;
      this.urlVal();
    }
  }

  // 上传文件
  handleDrop(event: DragEvent): void {
    event.preventDefault();
    event.stopPropagation();
    if (event.dataTransfer && event.dataTransfer.files.length > 0) {
      const file = event.dataTransfer.files[0];
      this.renderFile(file);
    }
  }

  urlVal(): void {
    this.loading = true;
    const url = this.urlPath;
    if (!url) {
      this.loading = false;
      return;
    }
  }

  private renderFile(file: File): void {
    const reader = new FileReader();
    reader.onload = (e: any) => {
      this.pngConfig.baseString = e.target.result;
      this.pngVal();
    };
    if (file.type.includes('image')) {
      reader.readAsDataURL(file);
    } else {
      reader.readAsText(file);
    }
  }

  handleTypeChange(): void {
    if (this.pngConfig.imgType === 'url') {
      this.baseString = '';
      this.urlPath = 'http://192.168.6.35/predicts/1.2.156.600734.762202257.139620.1730459902.8499.5400253/biomind/98117e9d-a22b-11ef-a3bc-1b7ba874f173/mask/404754_13.png';
    } else {
      this.urlPath = '';
    }
  }

  handleDicomSizeChange(): void {
    this.pngVal();
  }
}
